def solve():
    n, q = map(int, input().split())
    painters = [tuple(map(int, input().split())) for _ in range(q)]

    total_sections = {i for l, r in painters for i in range(l, r + 1)}
    visited = set()

    def dfs(curr, remaining):
        if remaining == 0:
            return len(visited)

        max_paint = 0
        for i in total_sections:
            if i not in visited and (i < curr or i > curr + 1):
                visited.add(i)
                max_paint = max(max_paint, dfs(i, remaining - 1))
                visited.remove(i)

        return max_paint

    max_painted = dfs(-1, q - 2)
    print(max_painted)

solve()

