    def is_koutsu(tiles):
        return any(tiles.count(tile) >= 3 for tile in set(tiles))

    def is_shuntsu(tiles):
        suits = {'m', 'p', 's'}
        for suit in suits:
            numbers = [int(tile[0]) for tile in tiles if tile[1] == suit]
            for i in range(1, 8):
                if all(num in numbers for num in range(i, i+3)):
