    if dist > n or (dist - n) % 2 != 0:
        print(-1)
    else:
        changes = (n - dist) // 2
        ur, ul, dr, dl = 0, 0, 0, 0
        for op in operations:
            if x > 0:
                ur += 1 if op == 'R' else 0
                dr += 1 if op == 'D' else 0
