def solve():
    n = int(input())
    operations = input()
    x, y = map(int, input().split())

    dx = 0
    dy = 0

    for op in operations:
        if op == 'U':
            dy += 1
        elif op == 'D':
            dy -= 1
        elif op == 'L':
            dx -= 1
        elif op == 'R':
            dx += 1

    if (x, y) == (dx, dy):
        print(0)
        return

    max_len = -1
    l = 0
    r = n - 1

    for i in range(n):
        if (abs(dx - x) + abs(dy - y) <= i + 1) and ((i + 1) % 2 == abs(dx - x + dy - y) % 2):
            if max_len == -1 or max_len > (r - l + 1):
                max_len = r - l + 1

        if operations[i] == 'U':
            dy -= 1
        elif operations[i] == 'D':
            dy += 1
        elif operations[i] == 'L':
            dx += 1
        elif operations[i] == 'R':
            dx -= 1

        if abs(dx - x) + abs(dy - y) <= i + 1:
            if (i + 1) % 2 == abs(dx - x + dy - y) % 2:
                if max_len == -1 or max_len > (r - l + 1):
