def solve():
    # Import required packages
    from collections import deque

    # Function to calculate minimum moves for a piece
    def min_moves(piece, curr_pos, target_pos):
        x_diff = abs(curr_pos[0] - target_pos[0])
        y_diff = abs(curr_pos[1] - target_pos[1])
        if piece == 'knight':
            return max(x_diff, y_diff) == 2 and min(x_diff, y_diff) == 1
        elif piece == 'bishop':
            return x_diff == y_diff
        elif piece == 'rook':
            return x_diff == 0 or y_diff == 0

    # Input function
    N = int(input())
    chessboard = [list(map(int, input().split())) for _ in range(N)]

    # Create a dictionary to store positions of each number
    number_positions = {}
    for i in range(N):
        for j in range(N):
            number_positions[chessboard[i][j]] = (i, j)

    # Initialize variables for moves and replacements
    moves = 0
    replacements = 0
    current_piece = 'knight'
    current_pos = number_positions[1]

    # Iterate from 2 to N^2 to find the best path
    for num in range(2, N**2 + 1):
        target_pos = number_positions[num]

        # Check if move is possible with the current piece
        if min_moves(current_piece, current_pos, target_pos):
            moves += abs(current_pos[0] - target_pos[0]) + abs(current_pos[1] - target_pos[1])
        else:
            moves += abs(current_pos[0] - target_pos[0]) + abs(current_pos[1] - target_pos[1])
            replacements += 1
            if current_piece == 'knight':
                if min_moves('bishop', current_pos, target_pos):
                    current_piece = 'bishop'
                else:
                    current_piece = 'rook'
            elif current_piece == 'bishop':
                if min_moves('knight', current_pos, target_pos):
                    current_piece = 'knight'
                else:
                    current_piece = 'rook'
            else:
                if min_moves('knight', current_pos, target_pos):
                    current_piece = 'knight'
                else:
                    current_piece = 'bishop'

        current_pos = target_pos

    print(moves, replacements)

