        return (cross(x1, y1, x3, y3, x4, y4) * cross(x2, y2, x3, y3, x4, y4) <= 0) and (cross(x3, y3, x1, y1, x2, y2) * cross(x4, y4, x1, y1, x2, y2) <= 0)

