        visited[curr] = True
        for neighbor in graph[curr]:
            if not visited[neighbor]:
                if not dfs(graph, visited, neighbor, curr, removed_edges):
                    return False
            elif neighbor != parent or (curr, neighbor) in removed_edges:
                return False
        return True

