        visited = [False] * (n + 1)
        acyclic = True

        for vertex in range(1, n + 1):
            if not visited[vertex]:
                if not dfs(graph, visited, vertex, 0, removed_edges):
                    acyclic = False
                    break

        if acyclic:
            print("YES")
            return

    print("NO")


