def split_typo_word(word: str) -> str:
    vowels = {'a', 'e', 'i', 'o', 'u'}
    typo_indices = [i for i in range(len(word)-2) if word[i] not in vowels 
                    and word[i+1] not in vowels 
                    and word[i+2] not in vowels 
                    and (word[i] != word[i+1] or word[i] != word[i+2])]

    if not typo_indices:
        return word

    split_word = [word[:typo_indices[0]+1]]
    for i in range(1, len(typo_indices)):
        split_word.append(word[typo_indices[i-1]+1:typo_indices[i]+1])
    split_word.append(word[typo_indices[-1]+1:])

    return ' '.join(split_word)

solve()

