def solve(n: int) -> int:
    MOD = 998244353

    def dp(n, col):
        if n < 0:
            return 0
        if n == 0:
            return 1
        if (n, col) in memo:
            return memo[(n, col)]

        res = 0
        if col == 0:
            res += dp(n - 1, 1)
        else:
            res += dp(n - 1, 0) * (n - 1)
            res += dp(n - 2, 1)
        res %= MOD

        memo[(n, col)] = res
        return res

    memo = {}
    return dp(n, 0)

