    res = ""

    while n > 0 and m > 0:
        if a[n-1] == b[m-1]:
            res = a[n-1] + res
            n -= 1
            m -= 1
        elif dp[n-1][m] > dp[n][m-1]:
            n -= 1
        else:
            m -= 1

    return res if res else "-"

