from collections import deque

def solve():
    n, m, k = map(int, input().split())
    special_vertices = set(map(int, input().split()))
    graph = {i: [] for i in range(1, n + 1)}

    for _ in range(m):
        u, v, w = map(int, input().split())
        graph[u].append((v, w))
        graph[v].append((u, w))

    def bfs(start):
        visited = {vertex: False for vertex in graph}
        distances = {vertex: float('inf') for vertex in graph}
        distances[start] = 0
        queue = deque([start])

        while queue:
            current_vertex = queue.popleft()
            visited[current_vertex] = True

            for neighbor, weight in graph[current_vertex]:
                if not visited[neighbor]:
                    new_distance = max(distances[current_vertex], weight)
                    if new_distance < distances[neighbor]:
                        distances[neighbor] = new_distance
                        queue.append(neighbor)

        farthest_distance = max([distances[vertex] for vertex in special_vertices])

        return farthest_distance

    output = [bfs(special_vertex) for special_vertex in special_vertices]
    print(*output)

