from collections import defaultdict
import heapq

def solve():
    n, m, k = map(int, input().split())
    special_vertices = set(map(int, input().split()))

    graph = defaultdict(list)
    for _ in range(m):
        u, v, w = map(int, input().split())
        graph[u].append((v, w))
        graph[v].append((u, w))

    def dijkstra(start):
        distances = {vertex: float('inf') for vertex in range(1, n+1)}
        distances[start] = 0
        queue = [(0, start)]

        while queue:
            cur_dist, cur_node = heapq.heappop(queue)

            if cur_dist > distances[cur_node]:
                continue

            for neighbor, weight in graph[cur_node]:
                new_dist = max(cur_dist, weight)
                if new_dist < distances[neighbor]:
                    distances[neighbor] = new_dist
                    heapq.heappush(queue, (new_dist, neighbor))

        return distances

    ans = []
    for vertex in special_vertices:
        distances = dijkstra(vertex)
        max_dist = 0
        for v in special_vertices:
            if distances[v] > max_dist:
                max_dist = distances[v]
        ans.append(max_dist)

    print(*ans)

solve()

