def solve():
    MOD = 10 ** 9 + 7

    a, b, k, t = map(int, input().split())

    dp = [[0] * (2*k*t+1) for _ in range(t+1)]
    dp[0][a-b+k*t] = 1

    for i in range(1, t+1):
        for j in range(2*k*t+1):
            dp[i][j] = (dp[i][j] + dp[i-1][j]) % MOD
            if j-k >= 0:
                dp[i][j] = (dp[i][j] + dp[i-1][j-k]) % MOD
            if j+k <= 2*k*t:
                dp[i][j] = (dp[i][j] - dp[i-1][j+k] + MOD) % MOD

    result = sum(dp[t][:k*t])
    return result % MOD

solve()

