        return max(meat_time(X, Y))

    def meat_time(X, Y):
        times = []
        for comb in combinations(meat, K):
            t = 0
            for x, y, c in comb:
                t = max(t, c * ((X - x) ** 2 + (Y - y) ** 2) ** 0.5)
            times.append(t)
        return times

    def ternary_search_x(L, R):
        eps = 10 ** -9
        while R - L > eps:
            m1 = L + (R - L) / 3
            m2 = R - (R - L) / 3
            f1, f2 = time_to_cook(m1, 0), time_to_cook(m2, 0)
            if f1 < f2:
                R = m2
            else:
                L = m1
        return (R + L) / 2

    X = ternary_search_x(-1000, 1000)
    print(time_to_cook(X, 0))

