import numpy as np

def solve():
    N, K = map(int, input().split())
    meats = [list(map(int, input().split())) for _ in range(N)]

    def distance(x, y):
        return np.sqrt(np.sum((np.array(meat[:2]) - np.array([x, y]))**2) for meat in meats)

    def time_to_eat(x, y):
        return sum(meat[2] * dist for meat, dist in zip(meats, distance(x, y)))

    def objective(xy):
        return time_to_eat(xy[0], xy[1])

    def minimize_error():
        from scipy.optimize import minimize
        result = minimize(objective, [0, 0], method='Powell')
        return result.fun

    print(minimize_error())

solve()

