        for i in range(M):
            part_sum = [weights[k] for k in range(N) if distances[k] < parts[i][1] < distances[k+1]]
            if sum(part_sum) > parts[i][1]:
                valid = False
                break
        if valid:
            min_distance = min(min_distance, distances[-1] - distances[0])

    if min_distance == float('inf'):
        print(-1)
    else:
        print(int(min_distance))

solve()

