def solve():
    n, x, y, c = map(int, input().split())

    def count_seconds(n, x, y, c):
        def is_happy(table, c):
            count = 0
            for i in range(n):
                for j in range(n):
                    if table[i][j] == 1:
                        count += 1
            return count >= c

        table = [[0] * n for _ in range(n)]
        table[x - 1][y - 1] = 1
        seconds = 0

        while not is_happy(table, c):
            new_table = [[0] * n for _ in range(n)]
            for i in range(n):
                for j in range(n):
                    if table[i][j] == 1:
                        for ni, nj in [(i-1, j), (i+1, j), (i, j-1), (i, j+1)]:
                            if 0 <= ni < n and 0 <= nj < n and new_table[ni][nj] == 0:
                                new_table[ni][nj] = 1

            table = new_table
            seconds += 1

        return seconds

    print(count_seconds(n, x, y, c))

