from heapq import heappush, heappop

def solve():
    N, M, P = map(int, input().split())
    graph = defaultdict(list)

    for _ in range(M):
        A, B, C = map(int, input().split())
        graph[A].append((B, C))

    dist = [float('inf')] * (N + 1)
    dist[1] = 0
    pq = [(0, 1)]

    while pq:
        time, node = heappop(pq)

        if node == N:
            return max(0, dist[N] - P * time)

        for neighbor, coins in graph[node]:
            if dist[node] + coins < dist[neighbor]:
                dist[neighbor] = dist[node] + coins
                heappush(pq, (dist[neighbor], neighbor))

    return -1

