from collections import defaultdict
from heapq import heappop, heappush

def solve():
    N, M, P = map(int, input().split())
    graph = defaultdict(list)

    for _ in range(M):
        A, B, C = map(int, input().split())
        graph[A].append((B, C))

    dp = [-float('inf')] * (N + 1)
    dp[1] = 0
    pq = [(0, 1)]

    while pq:
        coins, node = heappop(pq)
        if dp[node] > coins:
            continue

        for adj_node, adj_coins in graph[node]:
