def solve():
    import itertools

    n, m = map(int, input().split())
    edges = [tuple(map(int, input().split())) for _ in range(m)]

    dominoes = [(a, b) for a in range(1, 7) for b in range(a, 7)]
    max_dominoes = 0

    for edge_combination in itertools.product(dominoes, repeat=m):
        edge_directions = {}
        valid = True

        for i, edge in enumerate(edges):
            a, b = edge
            domino = edge_combination[i]

            if (a, b) in edge_directions and edge_directions[(a, b)] != domino:
                valid = False
                break

            edge_directions[(a, b)] = domino

        if valid:
            max_dominoes = max(max_dominoes, len(set(edge_directions.values())))

    print(max_dominoes)

