from collections import Counter

def solve(s: str) -> str:
    n = len(s)
    s = list(s)
    cnt = Counter(s)

    odd_char = ""
    for char, freq in cnt.items():
        if freq % 2 != 0:
            if odd_char:
                return "NO SOLUTION"

            odd_char = char
            cnt[char] -= 1

    half_palindrome = []
    for char, freq in cnt.items():
        half_palindrome.extend([char] * (freq // 2))

    half_palindrome.sort()

    ans = half_palindrome.copy()
    if odd_char:
        ans.append(odd_char)

    ans += half_palindrome[::-1]

    return ''.join(ans)

solve()

