def solve():
    import heapq

    def find_max_strength_after_hack(u, v, a, hacked):
        to_hack = []
        for i in [u, v]:
            if hacked[i] == 0:
                heapq.heappush(to_hack, -a[i])
        if len(to_hack) == 1:
            return heapq.heappop(to_hack)

    n = int(input())
    a = [0] + list(map(int, input().split()))
    hacked = [0] * (n + 1)
    edges = [[] for _ in range(n + 1)]

    for _ in range(n - 1):
        u, v = map(int, input().split())
        edges[u].append(v)
        edges[v].append(u)

    queue = [1]
    while queue:
        node = queue.pop()
        for v in edges[node]:
            if not hacked[v]:
                hacked[v] = 1
                hacked[node] += 1
                a[node] = max(a[node], find_max_strength_after_hack(node, v, a, hacked))
                queue.append(v)
    print(max(a[1:]))


