from itertools import permutations

def solve():
    R, B = map(int, input().split())
    rebels = [tuple(map(int, input().split())) for _ in range(R)]
    bases = [tuple(map(int, input().split())) for _ in range(B)]

    def check_intersection(p1, p2, p3, p4):
        def orientation(p, q, r):
            val = (q[1] - p[1]) * (r[0] - q[0]) - (q[0] - p[0]) * (r[1] - q[1])
            if val == 0: return 0
            return 1 if val > 0 else -1

        o1 = orientation(p1, p2, p3)
        o2 = orientation(p1, p2, p4)
        o3 = orientation(p3, p4, p1)
        o4 = orientation(p3, p4, p2)
        return (o1 != o2) and (o3 != o4)

    for perm in permutations(range(B)):
        valid = True
        for i in range(B):
            if check_intersection(rebels[i], bases[perm[i]], rebels[i + 1], bases[perm[i]]):
                valid = False
                break
        if valid:
            print("Yes")
            return
    print("No")

solve()

