def solve():
    import sys
    input = sys.stdin.readline

    class DSU:
        def __init__(self, n):
            self.parent = list(range(n))
            self.rank = [0] * n

        def find(self, u):
            if self.parent[u] != u:
                self.parent[u] = self.find(self.parent[u])
            return self.parent[u]

        def union(self, u, v):
            pu, pv = self.find(u), self.find(v)
            if pu == pv:
                return False
            if self.rank[pu] < self.rank[pv]:
                self.parent[pu] = pv
            elif self.rank[pu] > self.rank[pv]:
                self.parent[pv] = pu
            else:
                self.parent[pu] = pv
                self.rank[pv] += 1
            return True

    def is_tree(n, segments):
        dsu = DSU(n)
        for i in range(n):
            for j in range(i+1, n):
                if not (segments[i][1] <= segments[j][0] or segments[j][1] <= segments[i][0]):
                    if not dsu.union(i, j):
                        return False
        return len(set(dsu.find(i) for i in range(n))) == 1

    n = int(input())
    segments = [list(map(int, input().split())) for _ in range(n)]

    if is_tree(n, segments):
        print("YES")
    else:
        print("NO")

solve()

