def solve():
    N, X, D = map(int, input().split())
    MOD = 10**9 + 7

    if D == 0:
        if X == 0:
            return 1
        return N+1

    X = (X % D + D) % D
    X_times = {}
    cycle = {}
    order = 0
    for i in range(N+1):
        if i * D < X or (i * D - X) % D > 0:
            remain = X_times.get((i * X) % D, 0)
            X_times[(i * X) % D] = remain + 1
            cycle[(i * X) % D] = X_times[(i * X) % D]
            order += 1
    keys = list(cycle.keys())
    keys.sort()

    def nCr(n, r, MOD):
        res = 1
        for i in range(r):
            res *= (n-i) * pow(i+1, -1, MOD) % MOD
            res %= MOD
        return res

    ans = 0
    for k in keys:
        ans += nCr(N, order, MOD) - nCr(N, cycle[k], MOD)
        ans %= MOD
    return ans

solve()

