def solve():
    import math

    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True

    def next_prime(n):
        while(True):
            n += 1
            if is_prime(n):
                return n

    def prime_factors(n):
        factors = []
        i = 2
        while i * i <= n:
            if n % i:
                i += 1
            else:
                n //= i
                factors.append(i)
        if n > 1:
            factors.append(n)
        return factors

    def smallest_possible_starting_number(X2):
        factors = prime_factors(X2)
        x0 = X2
        for prime in factors:
            if x0 % prime != 0:
                x0 += prime - (x0 % prime)
        return x0 - X2

    X2 = int(input().strip())
    print(smallest_possible_starting_number(X2))

solve()

