def solve():
    import itertools

    def is_adjacent(tile1, tile2):
        row1, col1 = divmod(tile1, 13)
        row2, col2 = divmod(tile2, 13)

        return abs(row1 - row2) <= 1 and abs(col1 - col2) <= 1

    def form_path(grid, s):
        for i in range(len(s) - 1):
            current_tile = -1
            for tile, letter in enumerate(grid):
                if letter == s[i]:
                    current_tile = tile
                    break

            next_tile_found = False
            for next_tile, next_letter in enumerate(grid):
                if next_letter == s[i + 1] and is_adjacent(current_tile, next_tile):
                    next_tile_found = True
                    break

            if not next_tile_found:
                return False

        return True

    s = input().strip()
    grid_perms = itertools.permutations(s)

    for grid_perm in grid_perms:
        if form_path(grid_perm, s):
