    input = sys.stdin.readline

    n = int(input())
    if n == 1:
        print("YES\n0 0")
        return

    adj = [[] for _ in range(n)]
    for _ in range(n - 1):
        u, v = map(int, input().split())
        u -= 1
        v -= 1
        adj[u].append(v)
        adj[v].append(u)

    sub_sizes = [0] * n

    def dfs(v, p):
        sub_sizes[v] = 1
        for u in adj[v]:
